            GetCommentsJson = "{\"count\":34,\"results\":[{\"body\":\"A very poetic post today, @slowwalker.\n\nI'm reminded of our favourite author, Albert Camus who wrote, 'Autumn is a second spring when every leaf is a flower.' \n\nThe changing seasons mirror the intervals of the heart which also follows its rules of beginnings and ends, seedtime and harvest.\n\nFeeling unfruitful is often the melancholic response to the recognition of time passing and the sense that we could have accomplished more.\n\nRobert Frost expresses this ennui in his poem, After Apple Picking, where he describes his feelings of exhaustion and lack of accomplishment looking back on his work:\n\n*I am overtired \nOf the great harvest I myself desired. \nThere were ten thousand thousand fruit to touch, \nCherish in hand, lift down, and not let fall.*\n\nSo, console yourself with this, my friend, we all feel there is more we could have done, but we must be content with who we have become.\n\nWe have lived and learned and loved and in the end that is enough.\",\"title\":\"\",\"url\":\"/travel/@slowwalker/sunshine-and-scenery-of-the-autumn#@johnjgeddes/re-slowwalker-sunshine-and-scenery-of-the-autumn-20171002t130010080z\",\"category\":\"travel\",\"author\":\"johnjgeddes\",\"avatar\":\"https://i.imgsafe.org/8bc883baf4.jpg\",\"cover_image\":\"https://s26.postimg.org/qdm5kv9ft/IMG_1238.jpg\",\"author_rewards\":0,\"author_reputation\":70,\"net_votes\":1,\"children\":0,\"created\":\"2017-10-02T13:00:09Z\",\"curator_payout_value\":0.0,\"total_payout_value\":0.0,\"pending_payout_value\":0.268,\"max_accepted_payout\":1000000.0,\"total_payout_reward\":\"0.27\",\"vote\":false,\"flag\":false,\"tags\":[],\"image_size\":{},\"depth\":1},{\"body\":\"Cool nature, very nice,thanks for sharing\",\"title\":\"\",\"url\":\"/travel/@slowwalker/sunshine-and-scenery-of-the-autumn#@mohammedfelahi/re-slowwalker-sunshine-and-scenery-of-the-autumn-20171002t124356978z\",\"category\":\"travel\",\"author\":\"mohammedfelahi\